import React from 'react'
import App from '../App';
import '../style.css'

const AddAppliedJob = () => {
  return(
    <div className = "modal-content">
      <div className = 'modal-body'>
        <form>
          <label>Name:
          <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}


export default AddAppliedJob
